paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 1:
    case 3:
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 2);
            }

            return normalizedValue;
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 0.9 ? 0.9 : value));
            let normalizedValue = (value - 0) / (0.9 - 0);
            return normalizedValue;
        }
    case 7:
    case 8:
        {
            value = (value < 1 ? 1 : (value > 4000 ? 4000 : value));
            let normalizedValue = (value - 1) / (4000 - 1);
            return normalizedValue;
        }
    case 2:
        {
            value = (value < 10 ? 10 : (value > 500 ? 500 : value));
            let normalizedValue = (value - 10) / (500 - 10);
            return normalizedValue;
        }
    case 4:
        {
            value = (value < -10 ? -10 : (value > 10 ? 10 : value));
            let normalizedValue = (value - -10) / (10 - -10);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 1:
    case 3:
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (1 - 0);
            }
        }
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                value = this.applyStepsToNormalizedParameterValue(value, 2);
            }

            {
                return 0 + value * (1 - 0);
            }
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (0.9 - 0);
            }
        }
    case 7:
    case 8:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 1 + value * (4000 - 1);
            }
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 10 + value * (500 - 10);
            }
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return -10 + value * (10 - -10);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));

            {
                const oneStep = 1 / 1;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 1:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 2:
        {
            v = (v > 500 ? 500 : (v < 10 ? 10 : v));
            return v;
        }
    case 3:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 10 ? 10 : (v < -10 ? -10 : v));
            return v;
        }
    case 5:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 6:
        {
            v = (v > 0.9 ? 0.9 : (v < 0 ? 0 : v));
            return v;
        }
    case 7:
        {
            v = (v > 4000 ? 4000 : (v < 1 ? 1 : v));
            return v;
        }
    case 8:
        {
            v = (v > 4000 ? 4000 : (v < 1 ? 1 : v));
            return v;
        }
    default:
        return value;
    }
}
